<MDXTag name="td" components={components} parentName="tr" props={{"align":"right"}}>{`string`}</MDXTag>
</MDXTag>
<MDXTag name="tr" components={components} parentName="tbody">
<MDXTag name="td" components={components} parentName="tr" props={{"align":null}}>{`editorVisible`}</MDXTag>
